import React, { Component } from 'react'

export default class Home extends Component {
    render() {
        return (
            <div className="container">
                <div className="row">
                    <h1 className="col-12 text-title text-center home-title">FPBSD Summer Activity Center</h1>
                    <div className="gif"><iframe src="https://giphy.com/embed/l46CucCTE5duHKEla" width="100%" height="100%" style="position:absolute" frameBorder="0" class="giphy-embed" allowFullScreen></iframe></div><p><a href="https://giphy.com/gifs/summer-verano-summah-l46CucCTE5duHKEla">via GIPHY</a></p>
                </div>
                <div className="row">
                    
                </div>
            </div>
        )
    }
}
